export default {
  filmUser (parent, args, context) {
    return context.prisma.filmUserFinished({
      id: parent.id
    }).filmUser()
  },

  user (parent, args, context) {
    return context.prisma.filmUserFinished({
      id: parent.id
    }).user()
  }
}
